contracts/GovernanceDAO.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;
import './IVote.sol';
import './IProposal.sol';
import './IGovernance.sol';
import './IStake.sol';

contract GovernanceDAO is IVote, IProposal, IGovernance, IStake
{
    address public admin;

    struct Proposal
    {
        string description;
        VotingType votingType;
        uint[] voteCount;
        bool isExecuted;
        string[] choices;
        address[] users;

    }

    address[] internal enrolledMembers;
    address[] internal membersList;
    Proposal[] public proposals;

    mapping(address => bool) public members;
    mapping(address => bool) public enrolledList;
    mapping(address => uint256) public stakes;
    mapping(uint256 => mapping(address => uint256)) public singleVotes;
    mapping(uint256 => mapping(address => uint256[])) public multipleVotes;
    uint256 public totalStaked;
    uint256 public membersCount;
    uint256 public proposalCount;
    uint256 public enrolledMembersCount;
    constructor()
    {
        admin = msg.sender;
    }

    modifier onlyOwner
    {
       require(msg.sender == admin, "Only Administrator can perform this action");
        _;
    }

    modifier onlyMember
    {
        require(members[msg.sender], "Only Member can perform this action");
        _;
    }

    function changeAdmin(address _user) external onlyOwner
    {
        admin = _user;
    }

    function voteSingleChoice(uint256 proposalIndex, uint256 choiceIndex) external onlyMember
    {
        Proposal storage proposal  = proposals[proposalIndex];
        require(!proposal.isExecuted,"Proposal already executed");
        require(singleVotes[proposalIndex][msg.sender]==0, "Member already Voted");
        require(proposal.votingType == VotingType.SingleChoice, "Not a single-choice proposal");

        proposal.voteCount[choiceIndex]++;
        singleVotes[proposalIndex][msg.sender] = choiceIndex + 1;
    }

    function voteMultipleChoice(uint256 proposalIndex, uint256[] memory choiceIndices) external onlyMember
    {
        Proposal storage proposal = proposals[proposalIndex];
        require(!proposal.isExecuted, "Proposal already executed");
        require(proposal.votingType == VotingType.MultipleChoice, "Not a multiple-choice proposal");

        for (uint256 i = 0; i < choiceIndices.length; i++) {
            uint256 choiceIndex = choiceIndices[i];
            require(multipleVotes[proposalIndex][msg.sender][choiceIndex]==0, "Already voted for this choice");
            proposal.voteCount[choiceIndex]++;
            multipleVotes[proposalIndex][msg.sender][choiceIndex] = choiceIndex + 1;
        }
    }

    function addMember(address _member) external onlyOwner
    {
        membersList.push(_member);
        members[_member] = true;
        enrolledList[_member] = false;
        enrolledMembersCount--;
        membersCount++;

    }

    function getMembers() external onlyOwner view returns(address[] memory)
    {
        address[] memory addedMembers= new address[](membersCount);
        for(uint i=0; i<membersCount;i++)
        {
            addedMembers[i]= membersList[i];
        }

        return addedMembers;
    }

    function getProposals() external onlyOwner view returns(Proposal[] memory)
    {
        Proposal[] memory addedMembers= new Proposal[](membersCount);
        for(uint i=0; i < proposalCount;i++)
        {
            addedMembers[i]= proposals[i];
        }

        return addedMembers;
    }

    function removeMember(address _member) external onlyOwner
    {
        members[_member] = false;
        stakes[_member] = 0;
        membersCount--;
    }

    function stake() external payable onlyMember
    {
        require(msg.value > 0, "Stake amount should be greater than 0");

        stakes[msg.sender] += msg.value;
        totalStaked += msg.value;
    }

    function withdrawStake(uint256 amount) external onlyMember
    {
        require(stakes[msg.sender] >= amount, "Insufficient staked amount");

        stakes[msg.sender] -= amount;
        totalStaked -= amount;

        payable(msg.sender).transfer(amount);
    }

    function distributeRewards(uint proposalId) external onlyOwner
    {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.isExecuted, "Proposal is no executed yet");
         // Find the option with the highest vote count
        uint256 highestVoteCount = 0;
        uint256 winningChoiceIndex = 0;
        for (uint256 i = 0; i < proposal.voteCount.length; i++) {
            if (proposal.voteCount[i] > highestVoteCount) {
                highestVoteCount = proposal.voteCount[i];
                winningChoiceIndex = i;
            }
        }

        // Distribute rewards for single-choice voters
        for (uint256 i = 0; i < proposal.users.length; i++) {
            address member = proposal.users[i];
            if (singleVotes[proposalId][member] == winningChoiceIndex + 1) {
                uint256 reward = (stakes[member] / totalStaked) * address(this).balance;
                payable(member).transfer(reward);
            }
        }

        for (uint256 i = 0; i < proposal.users.length; i++) {
            address member = proposal.users[i];
            uint256[] memory choices = multipleVotes[proposalId][member];
            for (uint256 j = 0; j < choices.length; j++) {
                if (choices[j] == winningChoiceIndex) {
                    uint256 reward = (stakes[member] / totalStaked) * address(this).balance;
                    payable(member).transfer(reward);
                }
            }
        }

    }

    function penalize(address _member, uint256 _penaltyAmount) external onlyOwner
    {
        require(stakes[_member] >= _penaltyAmount, "Insufficient staked amount to penalize");
        stakes[_member] -= _penaltyAmount;
        totalStaked -= _penaltyAmount;

        payable(admin).transfer(_penaltyAmount);
    }

    function createSingleChoiceProposal(string memory _description, address[] memory _users, string[] memory _choices) external onlyOwner
    {
        string[] memory choices = new string[](_choices.length);
        for(uint i=0;i<_choices.length;i++)
        {
            choices[i]= _choices[i];
        }
        proposals.push(Proposal(
            _description,
            VotingType.SingleChoice,
            new uint256[](_choices.length),
            false,
            choices,
            _users)
        );
        proposalCount++;
    }

    function createMultipleChoiceProposal(string memory _description, address[] memory _users, string[] memory _choices) external onlyOwner
    {
        string[] memory choices = new string[](_choices.length);
        for(uint i=0;i<_choices.length;i++)
        {
            choices[i]= _choices[i];
        }
        proposals.push(Proposal(
            _description,
            VotingType.MultipleChoice,
            new uint256[](_choices.length),
            false,
            choices,
            _users)
        );

        proposalCount++;
    }

    function executeProposal(uint256 proposalIndex) external onlyOwner
    {
        Proposal storage proposal = proposals[proposalIndex];
        require(!proposal.isExecuted, "Proposal already executed");
        require(proposal.voteCount.length > 0, "No votes");

        proposal.isExecuted = true;
    }

    function getMyStake() external view onlyMember returns(uint amount)
    {
        return stakes[msg.sender];
    }

    function getEnrolledMembers() external view onlyOwner returns(address[] memory users)
    {
        address[] memory _users = new address[](enrolledMembersCount);
        uint usersCount = 0;
        for(uint i=0; i < enrolledMembersCount;i++)
        {
            address user = enrolledMembers[i];
            if(enrolledList[user] && user!=address(0))
            {
                _users[usersCount]= user;
                usersCount++;
            }
        }
        return _users;
    }

    function enrollMember(address _user) external
    {
        enrolledMembers.push(_user);
        enrolledList[_user] = true;
        enrolledMembersCount++;
    }
}

contracts/IGovernance.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;

interface IGovernance {
    function changeAdmin(address _user) external;
    function enrollMember(address _user) external;
    function getEnrolledMembers() external returns(address[] memory users);
    function addMember(address _member) external;
    function removeMember(address _member) external;
    function distributeRewards(uint proposalId) external;
    function penalize(address _member, uint256 _penaltyAmount) external;    
}

contracts/IProposal.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.8.0;
interface IProposal
{  
    function createSingleChoiceProposal(string memory _description, address[] memory _users,string[] memory _choices) external;
    function createMultipleChoiceProposal(string memory _description, address[] memory _users, string[] memory _choices) external;
    function executeProposal(uint256 proposalIndex) external;
}

